    private let names: [String] = ["ÐšÑƒÐ»Ð¸ÐºÐ¾Ð² Ð˜Ð»ÑŒÑ", "Ð¤ÐµÐ´Ð¾Ñ‚Ð¾Ð²Ð° ÐÐ½Ð½Ð°", "Ð®Ð´Ð¸Ð½Ð° ÐœÐ°Ñ€Ð¸Ñ", "Ð’Ð¸ÑˆÐ½ÐµÐ²ÑÐºÐ¸Ð¹ Ð’Ð»Ð°Ð´Ð¸Ð¼Ð¸Ñ€", "ÐÑ€Ñ…Ð¸Ð¿Ð¾Ð²Ð° ÐœÐ°Ñ€Ð¸Ñ"]
    
    //MARK: Public functions
    public func generatePost() -> Post {
        var post = Post.init(content: nil, contentImage: nil, authorImage: avatarImages.randomElement()!, authorName: names.randomElement()!, likesCount: Int.random(in: 2..<69), date: Date())
        let isHaveImage = Bool.random()
        if isHaveImage {
            post.contentImage = postImages.randomElement()
        }
        let isHaveText = Bool.random()
        if isHaveText {
            post.content = postTexts.randomElement()
        }
        if isHaveText == false && isHaveImage == false {
            post.content = postTexts.randomElement()
        }
        return post
    }
        
    public func generateArrayOfPosts(count: Int) -> [Post] {
        var posts: [Post] = []
        for _ in 0..<count {
            posts.append(generatePost())
        }
        return posts
    }
    
    public func generateUser() -> User {
        let user = User(avatarImage: avatarImages.randomElement()!, name: names.randomElement()!, city: "Kazan", phoneNumber: "+89083902021", friendsCount: Int.random(in: 14..<200), subscribersCount: Int.random(in: 14..<200), status: statusArr.randomElement()!)
        return user
    }
    
    public func fillArrayOfPostsForUser(user: User, count: Int) {
        for _ in 0..<count {
            user.posts.append(generatePostForUser(user: user))
        }
    }
    
    private func generatePostForUser(user: User) -> Post {
        var post = generatePost()
        post.authorImage = user.avatarImage
        post.authorName = user.name
        return post
    }
